import matplotlib.pyplot as plt
import matplotlib.cm as cm
import numpy as np
from math import sqrt

def showMatrix (L):
    if not type(L) is list:
        raise Exception("{} is not a list.".format(L))
    if not all(map(lambda x: x in {0,1,2}, L)):
        raise Exception("{} is not a list of zeros, ones, and twos.".format(L))
    l = len(L)
    n = int(sqrt(l))
    if n**2 != l:
        raise Exception("Length {} of list is not a square number.".format(l))
    M = np.array([L[k:k+n] for k in range(0,l,n)])
    plt.matshow(M, cmap=cm.gray_r)

def testChess (fn):
    errors = False
    for n, q, L in chessData:
        if fn(n,q) != L:
            print("Wrong output for {}({},{}).".format(fn.__name__,n,q))
            print("  Expected result: {}".format(L))
            print()
            errors = True
    if not errors:
        print("Cool, no errors found!")

def testAsteroids (fn):
    errors = False
    for n, p, s, L in asteroidsData:
        if fn(n,p,s) != L:
            print("Wrong output for {}({},{},{}).".format(fn.__name__,n,p,s))
            print("  Expected result: {}".format(L))
            print()
            errors = True
    if not errors:
        print("Cool, no errors found!")

